  showState = () => {
    this.setState({
      instName: "hamza",
    });
  };

  render() {
    return (
      <div>
        <div className="flex gap-3 py-3">
          <p className="w-2/6">- </p>

          <div className="flex flex-col gap-2 w-4/6">
            <button onClick={this.showState}> Test Button </button>
            <p> {this.state.myinstName} </p>
            <p> Degree: {this.props.previewState.institutionName} </p>
            <p> Subject: </p>
          </div>
        </div>
      </div>
    );
  }
}

export default PreviewEducation;
